def checkLeftBottom(m,v):
    dx = v[0] - m[0]
    if dx < 0:
        return v
    if dx > 0:
        return m
    if v[1] - m[1] > 0:
        return m
    else:
        return v


def leftBottomVertex(line_list) :

    leftBottomV = reduce(lambda x, y: checkLeftBottom(x, y), line_list)

    return leftBottomV

def make_plane_line(x, y):
	temp_list = []
	temp_list.append(x)
	temp_list.append(y)
	return temp_list

